import React, { useState, useEffect } from "react";
import { useStyles } from "./style";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import Typography from "@material-ui/core/Typography";
import Grid from "@material-ui/core/Grid";
import AccountCircleIcon from "@material-ui/icons/AccountCircle";

const headData = [
  {
    name: "Ăn uống",
    id: "anUong",
  },
  {
    name: "Nhà hàng uy tín",
    id: "nhaHangUyTin",
  },
  {
    name: "Ưu đãi hot",
    id: "uuDaiHot",
  },
  {
    name: "Mới nhất",
    id: "moiNhat",
  },
  {
    name: "Tin tức",
    id: "tinTuc",
  },
  {
    name: "Video",
    id: "video",
  },
];

const TypographyItems = (props) => {
  return (
    <Typography align="center" variant="h3" {...props}>
      {props.children}
    </Typography>
  );
};

const TopBar = () => {
  const classes = useStyles();

  const showHeadData = (headData) => {
    return headData.map((item) => {
      return (
        <TypographyItems key={item.id} className={classes.headDataItems}>
          {item.name}
        </TypographyItems>
      );
    });
  };

  return (
    <div className={classes.root}>
      <AppBar position="static" color="transparent">
        <Toolbar>
          <Grid container alignItems="center" spacing={2}>
            {/* Logo */}
            <Grid item xs={1}>
              <Typography className={classes.logo}></Typography>
            </Grid>
            {/* Middle */}
            <Grid item container alignItems="center" xs={8}>
              {showHeadData(headData)}
            </Grid>
            {/* Login/ Sign in */}
            <Grid container alignItems="center" justify="flex-end" item xs={3}>
              <AccountCircleIcon />
              <TypographyItems>Đăng nhập</TypographyItems>
            </Grid>
          </Grid>
        </Toolbar>
      </AppBar>
    </div>
  );
};

export default TopBar;
